All Saache si voller Middegkeet;
e Mann kann et net aussoen;
d'Ae ass net zefridden mam gesinn,
nach d'Ouer gefëllt mat héieren.
(Prediker 1:8)
IN leschte Wochen, de Vatikan huet vill iwwerrascht mat Ukënnegung betreffend de mystesch Räich. De verstuerwenen Fr. De Stefano Gobbi, deen d'Marian Movement of Priests gegrënnt huet, gouf als Déngscht vu Gott erkläert a seng Cause for canonization opgemaach; d'Kanoniséierungsprozess vun engem aneren Déngscht vu Gott, Luisa Piccarreta, war erausginn a nihil Obstat no enger kuerzer Paus virzegoen; den Vatikan bestätegt déi aktuell Bëschofs Uerteel betreffend déi angeblech Erscheinungen am Garabandal datt "et keng Elementer fir ze schléissen datt se iwwernatierlech sinn"; an de Phänomen ronderëm déi Joerzéngte-al a lafend Erscheinungen zu Medjugorje kruten en offiziellen Uerteel, nämlech eng nihil obstat. Continue reading

